import { Subject } from "rxjs/Subject";
import { Annonce } from "../models/Annonce";




export class AnnoncesServices{
  annonces:Annonce[]=[
    {
      id:0,
      nom:"aa",
      prix:10,
      description:"",
      photo:"data:image/jpeg;base64,",
      utilisateur:{
        id:0,
        nom:"Ben Chamakh",
        prenom:"Mohamed",
        email:"mohamed@gmail.com",
        passwd:"mohamed123",
        tel:"12345678"
      }
    }
  ];
  annoncesSubject = new Subject<Annonce[]>();

  mesAnnonces:Annonce[]=[];
  mesAnnoncesSubject = new Subject<Annonce[]>();

 constructor(){
   
 }

  ajouter(annonce:Annonce){
    return new Promise(
      (resolve,reject)=>{
        if(annonce==null) reject(false);
        annonce.id=this.annonces.length+1;

        this.mesAnnonces.push(annonce);
        this.annonces.push(annonce);


        this.emitAnnonces();
        this.emitMesAnnonces();

        resolve(true);
      }
    )
      
  }

  supprimer(id:number){
    return new Promise(
      (resolve,reject)=>{
        let index= this.annonces.findIndex(element=>element.id==id);
        let myIndex= this.mesAnnonces.findIndex(element=>element.id==id);

        this.annonces.splice(index,1);
        this.mesAnnonces.splice(myIndex,1);
        
        this.emitAnnonces();
        this.emitMesAnnonces();
        
        resolve(true);
      }
    )

  }

  loadMesAnnonces(id:number){
    this.mesAnnonces=this.annonces.filter(element=> element.utilisateur.id==id);
    this.emitMesAnnonces();
  }

  supprimerMesAnnonces(){
    this.mesAnnonces=[];
    this.emitMesAnnonces();
  }

  emitMesAnnonces(){
    this.mesAnnoncesSubject.next(this.mesAnnonces);
  }
  

  emitAnnonces(){
    this.annoncesSubject.next(this.annonces);
  }
  
}